import React, { useState } from 'react';
import TodoList from './TodoList';

export default function Todo() {
  const [todo, setTodo] = useState([
    { id: 0, todo: '김지윤바보', done: true },
    { id: 1, todo: '김지윤똥개', done: true },
    { id: 2, todo: '김지윤멍청이', done: true },
  ]);
  return (
    <>
      <TodoList todo={todo} />
    </>
  );
}
